="cards" data-field-route="/card/1" index="1" class="x-el x-el-div x-el c1-1 c1-2 c1-1g c1-4x c1-7v c1-4h c1-2c c1-4 c1-7w c1-7x c1-7y c1-b c1-c c1-7z c1-80 c1-d c1-e c1-f c1-g x-d-ux x-d-field-id x-d-field-route c1-1 c1-2 c1-b c1-c c1-d c1-e c1-f c1-g x-d-ux x-d-field-id x-d-field-route"><h4 typography="HeadingDelta" data-ux="ContentCardHeading" data-aid="ABOUT_HEADLINE_RENDERED1" data-route="cards.headline" data-field-route="/card/1" class="x-el x-el-h4 c1-1 c1-2 c1-29 c1-2a c1-6r c1-2i c1-32 c1-1k c1-1m c1-b c1-2h c1-5h c1-40 c1-5k c1-5m c1-5n c1-5o x-d-ux x-d-aid x-d-route x-d-field-route">Bringing the Game to You</h4><div typography="BodyAlpha" data-ux="ContentCardText" data-aid="ABOUT_DESCRIPTION_RENDERED1" data-route="cards.description" data-field-route="/card/1" class="x-el x-el-p c1-1 c1-2 c1-29 c1-2a c1-4l c1-1k c1-1m c1-81 c1-82 c1-83 c1-84 c1-85 c1-86 c1-87 c1-88 c1-89 c1-8a c1-8b c1-8c c1-8d c1-8e c1-8f c1-8g c1-8h c1-8i c1-8j c1-8k c1-8l c1-8m c1-8n c1-8o c1-8p c1-8q c1-8r c1-8s c1-b c1-37 c1-c c1-40 c1-d c1-e c1-f c1-g x-d-ux x-d-aid x-d-route x-d-field-route x-rt"><p style="margin:0"><span>I stream my gameplay every Tuesday and Thursday at 1pm PST. You can follow along and ask questions about why I do what I do. I also offer a service where I will play along with you, helping you gear up and become an all-around better player.</span></p></div></div></div><div data-ux="GridCell" class="x-el x-el-div c1-1 c1-2 c1-1h c1-2w c1-1w c1-5y c1-19 c1-1y c1-2y c1-47 c1-21 c1-b c1-c c1-8x c1-8y c1-22 c1-23 c1-7u c1-25 c1-d c1-e c1-f c1-g x-d-ux"><div data-ux="ContentCard" data-field-id="cards" data-field-route="/card/2" index="2" class="x-el x-el-div x-el c1-1 c1-2 c1-1g c1-4x c1-7v c1-4h c1-2c c1-4 c1-7w c1-7x c1-7y c1-b c1-c c1-7z c1-80 c1-d c1-e c1-f c1-g x-d-ux x-d-field-id x-d-field-route c1-1 c1-2 c1-b c1-c c1-d c1-e c1-f c1-g x-d-ux x-d-field-id x-d-field-route"><h4 typography="HeadingDelta" data-ux="ContentCardHeading" data-aid="ABOUT_HEADLINE_RENDERED2" data-route="cards.headline" data-field-route="/card/2" class="x-el x-el-h4 c1-1 c1-2 c1-29 c1-2a c1-6r c1-2i c1-32 c1-1k c1-1m c1-b c1-2h c1-5h c1-40 c1-5k c1-5m c1-5n c1-5o x-d-ux x-d-aid x-d-route x-d-field-route">About Me</h4><div typography="BodyAlpha" data-ux="ContentCardText" data-aid="ABOUT_DESCRIPTION_RENDERED2" data-route="cards.description" data-field-route="/card/2" class="x-el x-el-p c1-1 c1-2 c1-29 c1-2a c1-4l c1-1k c1-1m c1-81 c1-82 c1-83 c1-84 c1-85 c1-86 c1-87 c1-88 c1-89 c1-8a c1-8b c1-8c c1-8d c1-8e c1-8f c1-8g c1-8h c1-8i c1-8j c1-8k c1-8l c1-8m c1-8n c1-8o c1-8p c1-8q c1-8r c1-8s c1-b c1-37 c1-c c1-40 c1-d c1-e c1-f c1-g x-d-ux x-d-aid x-d-route x-d-field-route x-rt"><p style="margin:0"><span>I can't remember when I didn't play video games. I still revisit some of the classic games for speed runs and a nostalgia kick. On the rare days when I'm not streaming, I like to get out to the rock climbing gym and try new pizza places with friends.</span></p></div></div></div></div></div></section> </div></div></div><div id="20887e05-d4c1-41e8-95b3-898d17acc76d" class="widget widget-video widget-video-video-1"><div data-ux="Widget" class="x-el x-el-div x-el c1-1 c1-2 c1-3 c1-b c1-c c1-d c1-e c1-f c1-g x-d-ux c1-1 c1-2 c1-b c1-c c1-d c1-e c1-f c1-g x-d-ux"><div><section data-ux="Section" class="x-el x-el-section c1-1 c1-2 c1-3 c1-i c1-j c1-b c1-c c1-r c1-s c1-d c1-e c1-f c1-g x-d-ux"><div data-ux="Container" class="x-el x-el-div c1-1 c1-2 c1-15 c1-16 c1-17 c1-18 c1-19 c1-b c1-c c1-1c c1-d c1-1d c1-e c1-1e c1-f c1-1f c1-g x-d-ux"><div data-ux="Intro" class="x-el x-el-div x-el c1-1 c1-2 c1-7m c1-4h c1-b c1-c c1-d c1-e c1-f c1-g x-d-ux c1-1 c1-2 c1-b c1-c c1-d c1-e c1-f c1-g x-d-ux"><h4 typography="HeadingBeta" data-ux="SectionHeading" data-aid="VIDEO_SECTION_TITLE_RENDERED" data-field-id="sectionTitle" data-route="sectionTitle" class="x-el x-el-h4 c1-1 c1-2 c1-29 c1-2a c1-7l c1-2i c1-32 c1-1k c1-1m c1-4w c1-5s c1-6b c1-53 c1-2h c1-40 c1-7n c1-55 c1-64 c1-56 